import {
  MenuButton,
  MenuItem,
  MenuList,
  Avatar,
  Menu,
  Flex,
  IconButton,
} from "@chakra-ui/react";
import React from "react";
import { Container } from "react-bootstrap";

const Navbar = () => {
  return (
    <Container bg="gray.500" p={2}>
      <Flex>
        <Menu>
          <MenuButton>
            <Avatar />
          </MenuButton>
          <MenuList>
            <MenuItem>Profile</MenuItem>
            <MenuItem>Sttings</MenuItem>
          </MenuList>
        </Menu>
      </Flex>
    </Container>
  );
};

export default Navbar;
